import React, { useState } from 'react';
import RandomUserContext from '../../../store/randomuser-context';

import RandomUserContainer from './Container/RandomUserContainer';

const RandomUser = () => {
	const [User, setUser] = useState([]);

	return (
		<RandomUserContainer>
			<h2>Random user</h2>
		</RandomUserContainer>
	);
};

export default RandomUser;
